import React from 'react';
import '../App.css';
import {  useLocation } from 'react-router-dom';

function Form() {
  const loc = useLocation();
  console.log(loc);
  return (
    <div class='Form'>
            <header class="App-header">
        <p>com.Form</p>
        <p>Case ID: id</p>
        <p>Case URL:  {loc.pathname}  </p>

      </header>
    </div>
  );
}

export default Form;
